import './Home.css';
import React, { Component } from 'react';


function Home() {
  return (
    <div className="Home">
      <header className='Home-header'>
        BATTLESHIP
      </header>
      <button>Play</button>
      <button>Create room</button>
    </div>
  );
}

export default Home;
